  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css',
  ]
})
export class HomeComponent {
}
<div class="container">
  <div class="row">
    <div class="col-md-6"> <img src="assets/your_image.jpg" alt="Image description" class="img-fluid"> </div>
    <div class="col-md-6"> <h1>exam</h1>

      <p>HRD Exam</p>
      <p>Korea Software HRD Center</p>

      <button type="button" class="btn btn-primary">Start Quiz</button>
      <button type="button" class="btn btn-secondary">Register ?</button>
    </div>
  </div>
</div>
